function randomString(length){
    var output="",character="ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789";
    for(var i=0;i<length;i++){
        var int = Math.floor(Math.random()*(Math.floor(character.length-1)));
        output+=character[int];
    }
    return output;
}
console.log(randomString(10));